function pointsEaten() {
    pointPosition.forEach((pos, idx) => {
        if ((pacmanLeftX <= pos[0] && pacmanRightX >= pos[0]) && (pacmanTopY <= pos[1] && pacmanBottomY >= pos[1])) {
            wallGrid[pointLocation[idx]] = 0;
        }
    });
    bonusPointPosition.forEach(pos => {
        if ((pacmanLeftX <= pos[0] && pacmanRightX >= pos[0]) && (pacmanTopY <= pos[1] && pacmanBottomY >= pos[1])) {
            wallGrid[pos[2]] = 0;
            let array = [];
            bonusPointLocation.forEach(loc => {
                if (pos[2] != loc[3]) {
                    array.push(loc);
                }
            });
            bonusPointLocation = array;
        }
    });
}

function drawBitmapWithDirection(useBitmap, atX, atY, withAng) {
    canvasContext.save();
    canvasContext.translate(atX, atY);
    canvasContext.rotate(withAng);
    canvasContext.drawImage(useBitmap, -useBitmap.width/2, -useBitmap.height/2);
    canvasContext.restore();
}

