function updateSometimes() {
    drawBonusPointBall();
}


function updateAll() {
    if (introStage) {
        drawBackground();
        drawBonusPointBall();
        drawWalls();
        drawReady();
        drawPlayerOne();
    } else {
        drawBackground();
        drawWalls();
        drawPacman();
        drawBlinky();
        drawPinky();
        drawInky();
        drawClyde();
        moveAll();
        pointsEaten();
    }
}

function drawBackground() {
    canvasContext.fillStyle = 'black';
    canvasContext.fillRect(0, 0, canvas.width, canvas.height);
}

function drawReady() {
    if (readyLoaded) {
        drawBitmapWithDirection(ready, readyX, readyY, readyAng);
    }
}

function drawBonusPointBall() {
    if (introStage && blinkingBonusPoint) {
        bonusPointLocation.forEach(pos => drawBitmapWithDirection(bonusPointBall, pos[0], pos[1], pos[2]));
    } else if (blinkingBonusPoint) {
        bonusPointLocation.forEach(pos => drawBitmapWithDirection(bonusPointBall, pos[0], pos[1], pos[2]));
        blinkingBonusPoint = false;
    } else {
        bonusPointLocation.forEach(pos => drawBitmapWithDirection(bonusPointBallHidden, pos[0], pos[1], pos[2]));
        blinkingBonusPoint = true;
    }
}

function drawPlayerOne() {
    if (playerOneLoaded) {
        drawBitmapWithDirection(playerOne, playerOneX, playerOneY, playerOneAng);
    }
}

